import React from 'react';

interface Istate{
    count:number

}

export default class Submit extends React.Component<Istate>{
    public constructor(props:any) {
      super(props);
      this.state={
          count:0
      }
    }
    
    public render() {
      return (
        <div>
          <p>You clicked {this.state.count} times</p>
          <button onClick={() => this.setState({ count: this.state.count + 1 })}>
            Click me
          </button>
        </div>
      );
    }
  }
